import ExpenseItem from "./ExpenseItem";
import React from 'react';
import './Expenses.css'
function Expenses({expenses}) {

    return (
        <div className={"expenses"}>
            {expenses.map((expense, index) => (
                <ExpenseItem
                    key={index}
                    title={expense.title}
                    amount={expense.amount}
                    date={expense.date}
                />
            ))}
        </div>
    );
}

export default Expenses;
